Blu is een zeldzame Macaw papegaai die denkt dat hij de laatste van zijn soort is. Wanneer hij echter ontdekt dat dit helemaal niet zo is, besluit hij zijn kooi in Minnesota te verlaten en op reis te gaan naar Rio de Janeiro. Samen met Jewel, de andere zeldzame papegaai van zijn soort, komt Blu in een onverwacht avontuur terecht.

